'use client';

import { usePathname } from 'next/navigation';
import Text from './Text';
import './Header.styles.css';

export default function Header() {
    return (
        <header className="SafariDigital-Header">
            <Logo />
            <Nav
                paths={[
                    { link: '#id1', name: 'accueil' },
                    { link: '#id2', name: 'à propos' },
                    { link: '#id3', name: 'prestations' },
                    { link: '#id4', name: 'réalisations' },
                    { link: '#id5', name: 'blog' },
                    { link: '#id6', name: 'contact' },
                ]}
            />
        </header>
    );
}

function Nav(props: { paths: Array<{ link: string; name: string }> }) {
    const pathname = usePathname();

    return (
        <nav className="SafariDigital-Header-Nav">
            <ul>
                {props.paths.map(({ link, name }) => (
                    <li
                        key={name}
                        className={
                            pathname === link
                                ? 'SafariDigital-Header-Nav-Item SafariDigital-Header-Nav-Item-Active'
                                : 'SafariDigital-Header-Nav-Item'
                        }>
                        <Text.Link href={link}>{name}</Text.Link>
                    </li>
                ))}
            </ul>
        </nav>
    );
}

